import styled from '@emotion/styled'

import { Headline, MainWrapper, PageWrapper } from 'Layouts'
import { pageTransitionEasing, slideUp } from 'styles'

export const HomeWrapper = styled(PageWrapper)`
  max-width: initial;
  animation: ${slideUp} ${pageTransitionEasing} 0.5s;
`

export const HomeHeadline = styled(Headline)`
  text-align: center;
`

export const SearchWrapper = styled(MainWrapper)`
  text-align: center;
  margin-right: center;
  margin-left: center;
`
